import React from 'react'
import { ToggleButton, ToggleButtonGroup, Stack } from 'react-bootstrap';
import AMPImage from '../images/amp.png'
import USAPLImage from '../images/usapl.png'
import USPAImage from '../images/uspa.png'

const fedImages = {"USPA": USPAImage, "USAPL": USAPLImage, "AMP": AMPImage}
export default function FederationForm({ federations, setFederationFilter, federationFilter }){
  const handleChange = (val) => setFederationFilter(val);
  return (
    <ToggleButtonGroup vertical type="checkbox" value={federationFilter} onChange={handleChange} style={{width: "100%"}}>
      {federations.map((federation, ind) => {
        return (
          <ToggleButton key={federation} id={`tbg-btn${federation}`} value={federation}>
            <img class="mx-auto" style={{width:"50%", height: "auto"}} src={fedImages[federation]} alt={federation} />
          </ToggleButton>
          )
        })
      }
    </ToggleButtonGroup>
  )
}
